INSERT INTO ay_content VALUES(26,'cn','22','','Automatic Blowing Machine','#333333','','','超级管理员','本站','','2023-05-29 13:18:02','/static/upload/image/20230912/1694501595102644.jpg','','&lt;p&gt;&lt;img src=&quot;/static/upload/image/20230719/1689736184901226.jpg&quot; title=&quot;1689736184901226.jpg&quot; alt=&quot;2C Auto Bottle Blowing Machine.jpg&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;BOTTLE BLOWING PROCESS&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;PREFORM LOADING&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Performs put into loading hopper, then the conveyor raise the performs to perform unsbreller, hence the performs will be arranged well on the guider. The performs will go into equipment automatically. This type of loading complete automatic control, high efficiency without damage to performs.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;HEATING ADJUST&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;The heating head will receive performs automaticly and continuously, and performs average round self running, can get suitable reasonable heating when moving through heating area. Blowing machine adopts to far infrared heating controlled by silicon, every line of the lamps can control temperature independently. If lamp no electric, machine will alarm test automaticly. The air flow in heating area, and the perform neck protection device both designed precisely, in this case, perform can get ideal temperature heating, also bottle neck no influence. If necessary, temperature testing device can help adjust temperature automaticly. Each class of the heating temperature showed on the meter, easy look, easy operate.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;STRECH BLOWING&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;PLC can control the mould frame open and close precisely. Easy and stable mould frame structure, lead to easier mould changing. Mould locking and pressure enlarging system is special. Blowing data of each cavity is controlled by touch screen very easier, it has good testing function. The special structure of the blow mouth ensures stable sealing no matter different blowing pressure, and also ensures finished bottle rate.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;BOTTLES EJECTING&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;After blowing, robot hand will take finished bottles automatically and test bottles, if bottles not well automatically knick out.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 150%;&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;This ensures the continuously production. The bottles convey to filling machine by air conveyor.&lt;/span&gt;&lt;/p&gt;','','','','BOTTLE BLOWING PROCESSPREFORM LOADINGPerforms put into loading hopper, then the conveyor raise the performs to perform unsbreller, hence the performs will be arranged well on the guider. The performs will go into equipment automatically. This type of loading complete automatic control, high efficien',255,'1','0','0','0',145,0,0,'admin','admin','2023-05-29 13:19:08',' 2023-09-12 14:53:23','4','0','','');
