age filling and packing machines. &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 30px; padding: 0px; color: rgb(39, 38, 38); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span class=&quot;s1&quot; style=&quot;box-sizing: border-box;&quot;&gt;&amp;nbsp; &amp;nbsp;We supply turnkey project according to customers request, including workshop design, machine layout design, water, gas, electic cable layout design, label and bottle design.&lt;/span&gt;&lt;/p&gt;&lt;table&gt;&lt;tbody&gt;&lt;tr class=&quot;firstRow&quot;&gt;&lt;td width=&quot;1035&quot; valign=&quot;top&quot; style=&quot;word-break: break-all;&quot;&gt;&lt;span style=&quot;font-size: 24px; color: rgb(63, 63, 63);&quot;&gt;Technology Innovation&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p&gt;&lt;img src=&quot;/static/upload/image/20230922/1695371311210192.jpg&quot; title=&quot;1695371311210192.jpg&quot; alt=&quot;专利 1.jpg&quot;/&gt;&lt;/p&gt;','','','water bottling line, water bottling plant, water filling line, water filling plant, water filling machine, water bottling machine','the water filling line can produce bottled drinking water for PET bottle 200ml to 2L in one line.',255,'1','1','0','0',600,0,0,'admin','admin','2023-05-31 14:00:49',' 2024-01-08 09:01:51','4','0','','');
INSERT INTO ay_content VALUES(131,'cn','17','','Auto Sleeve Labeling Machine','#333333','','','超级管理员','本站','','2023-05-31 14:22:18','/static/upload/image/20230912/1694502281454351.jpg','','&lt;p&gt;&lt;img src=&quot;/static/upload/image/20230719/1689752867115653.jpg&quot; title=&quot;1689752867115653.jpg&quot; alt=&quot;Auto Sleeve Labeling Machine 2.jpg&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left;text-indent:8px;line-height:150%&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif;color:black&quot;&gt;General description&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif;color:black&quot;&gt;This machine adopts international advanced technology, sleeve the circle label on the bottle, and then hot shrinking to fix on the position which bottle body designated.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:23px;line-height:150%&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Features:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;1) &lt;span style=&quot;color:black&quot;&gt;The machinery part adopts combination designing of modularization, and makes the machine reasonable. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;2) &lt;span style=&quot;color:black&quot;&gt;The height adjustment adopts motor fluctuating, it is convenient to replace the bottle size.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;3) &lt;span style=&quot;color:black&quot;&gt;The special cutter head designing, make the film-rolling cut more exactly and reliably.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;4) Transferring label device can be adjusted conveniently without tools, which make is more suitable for different bottle sizes.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;5) Forced insertion design proves to be reasonable and convenient.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;6) Special designed knife plate is changed free with the related specifications.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;7) Newel nip system, newel can be changed and installed rapidly without tools.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;8) Dividing bottle screw, positioning belt, transporting chain work synchronously, adjust conveniently.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;9) Using world famous servo motor and high-sensitivity optoelectronic sensor, the length of cut label is accurate.&lt;/span&gt;&lt;/p&gt;