INSERT INTO ay_content VALUES(132,'cn','37','','Hot-melting Glue Labeling Machine','#333333','','','超级管理员','本站','','2023-05-31 14:25:47','/static/upload/image/20230912/1694502314156034.jpg','','&lt;p&gt;&lt;img src=&quot;/static/upload/image/20230719/1689752715182629.jpg&quot; title=&quot;1689752715182629.jpg&quot; alt=&quot;Hot-melting Glue Labeling Machine 2.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Arial&amp;#39;,sans-serif;color:#222222&quot;&gt;Labeling method:&lt;br/&gt; 1. From the bottle, see the bottle rotate clockwise and attach the label to the bottle.&lt;br/&gt; 2. The bottle labeling position should be 3.5mm wider than the label.&lt;br/&gt; Main performance:&lt;br/&gt; 7-foot color touch screen, friendly man-machine interface, easy to operate, full-featured;&lt;br/&gt; The whole machine adopts an integrated steel frame structure and the equipment is stable;&lt;br/&gt; The main accessories of the whole machine adopt imported famous brands;&lt;br/&gt; The use of advanced hot melt glue rolling technology to achieve a perfect sizing labeling effect;&lt;br/&gt; Rotary labeling method, the upper and lower belt molds clamp the bottle, the cam makes the bottle actively rotate, and the sealing precision of the label reaches 1mm;&lt;br/&gt; With automatic alarm system, alarm warning or alarm shutdown in case of card bottle, missing standard, missing mark, lack of bottle, temperature detection, etc.&lt;br/&gt; The countertop is made of stainless steel&lt;br/&gt; Technical specifications:&lt;br/&gt; Maximum labeling stability speed: 6,000 bottles / hour; 500ml bottle labeling machine.&lt;br/&gt; Label type: OPP film label, thickness 0.03-0.05mm.&lt;br/&gt; Labeling accuracy: 1mm;&lt;br/&gt; Label colloid: use Henkel EM362 hot melt adhesive, or the same performance hot melt adhesive&lt;br/&gt; Label station: 12 stations;&lt;br/&gt; The front is equipped with a 2m conveyor chain and is followed by a 1=2m conveyor chain.&lt;br/&gt; Power supply: three-phase five-wire system, L1, L2, L3, N, PE.&lt;br/&gt; Energy consumption: about 7.3kw during normal operation (slightly 15% when starting up) Main accessories:&lt;br/&gt; Japan Omron industrial computer plc 1 set&lt;br/&gt; British motion controller 1 set&lt;br/&gt; Japan Panasonic color sensor 1 set&lt;br/&gt; Taiwan Delta servo motor 1 set&lt;br/&gt; Panasonic&amp;#39;s photoelectric sensor 1 set&lt;br/&gt; Taiwan Delta touch screen 1 set&lt;br/&gt; Taiwan Delta inverter 3 sets&lt;br/&gt; Korea Autonics rotary encoder (spindle coding) 1 set&lt;br/&gt; Changchun Timesin Optical Encoder (for tension) 1 set&lt;br/&gt; South Korea Autonics proximity sensor 3 sets&lt;br/&gt; South Korea Autonics photoelectric sensor 4 sets&lt;br/&gt; German steel knife cutting knife 2, fixed knife 1&lt;br/&gt; South Korea Autonics precision pid thermostat 5 sets&lt;br/&gt; Domestic precision planetary gear reducer 1 set&lt;br/&gt; Domestic motor with worm gear reducer 3 sets&lt;br/&gt; Taiwan Yadeke Pneumatic Components&lt;br/&gt; Machine size:&lt;br/&gt; Table top 2013mm long *1486mm wide * machine 2000mm high.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','','','','Labeling method: 1. From the bottle, see the bottle rotate clockwise and attach the label to the bottle. 2. The bottle labeling position should be 3.5mm wider than the label. Main performance: 7-foot color touch screen, friendly man-machine interface, easy to operate, full-featured; The whole machin',255,'1','0','0','0',48,0,0,'admin','admin','2023-05-31 14:27:21',' 2023-09-12 15:05:20','4','0','','');
INSERT INTO ay_content VALUES(133,'cn','36','','Auto Self-adhesive Label Sticker','#333333','','','超级管理员','本站','','2023-05-31 14:27:22','/static/upload/image/20230912/1694502164203229.jpg','','&lt;p&gt;&lt;img src=&quot;/static/upload/image/20230719/1689739833154735.jpg&quot; title=&quot;1689739833154735.jpg&quot; alt=&quot;adhesive labeling machine.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Features:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;1) Main body is made by S304 stainless steel &amp;amp; processing by anode of aluminum metal&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;2) Head of label is import from Japan of stepping motor driving.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;3) The high-grade photo sensor made in Japan or West Germany.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;4) PLC control system match human machine interface &amp;amp; included sixty-suite memory unit.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;5) This machine suit for little quantity and variety works or the time one operator operating single machine only.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;6) Additional function of battle correction. battle split, counter and Label ironing.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;7) Label position&lt;/span&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:宋体&quot;&gt;，&lt;/span&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;height and angle can adjustable.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;8) Able to connect conveyor on product line&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','','','','Features:1) Main body is made by S304 stainless steel &amp;amp; processing by anode of aluminum metal2) Head of label is import from Japan of stepping motor driving.3) The high-grade photo sensor made in Japan or West Germany.4) PLC control system match human machine interface &amp;amp; included sixty-suite',255,'1','0','0','0',63,0,0,'admin','admin','2023-05-31 14:28:38',' 2023-09-12 15:02:48','4','0','','');
INSERT INTO ay_content VALUES(134,'cn','18','','L type PE Film Shrink Packing Machine','#333333','','','超级管理员','本站','','2023-05-31 14:40:25','/static/upload/image/20230912/1694487715405710.jpg','','&lt;p&gt;&amp;nbsp;&amp;nbsp;&lt;img src=&quot;/static/upload/image/20230912/1694487697207733.jpg&quot; title=&quot;1694487697207733.jpg&quot; alt=&quot;L PE Film Shrink Wrapping Machine 1.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Usage:&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt; the machine is used for packing bottled water, drink, or canned drink into a pack with PE film. Don’t need backing board or paper plate when packing; it will save the cost of packing. It is widely used in production of mineral water, pure water, soft drink, beer, juice and so on.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Features:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;1) Special designed for the full automatic packaging production line of beer, beverage, pure water, fruit juice, dairy products etc.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;2) With full automatic functions of bottle transfer and arrange, film packing, sealing and cutting, shrinking, cooling and shaping etc.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;3) Using advanced constant temperature membrane heat binding technology in the world with clear and secure seal.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;4) The quick seal cooling structure guarantee that the seal has a higher strength even if under high speed production condition.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;5) Adopt PLC automatic program circulation control with stable and reliable performance.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-indent:8px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;6) The original imported guide bar cylinder guarantee correct operation and durable.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;7) The inductive switch controls the film transfer system to reliably adjust and control the film transfer length with less loss.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;8) All the transfer system is controlled by frequency changing devices with stable and smooth transfer speed.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;9) Unique thermal passage with 2 sets of centrifugal thermal air circulation system that has an equal heat distribution with beautiful and secure shrinkage effect.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;10) 3 layers of heat insulation treatment with good insulating property, quick temperature rise and energy saving.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;11) The enhanced cooling shaping passage can quickly turn the packaging membrane into high strength status that is conveniently stored and transported.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:7px;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;12) It is easy to change the packaging combination and bottle type to integrate the multi-function into one machine&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','','','','Usage: the machine is used for packing bottled water, drink, or canned drink into a pack with PE film. Don’t need backing board or paper plate when packing; it will save the cost of packing. It is widely used in production of mineral water, pure water, soft drink, beer, juice and so on.Features:1)',255,'1','0','0','0',98,0,0,'admin','admin','2023-05-31 14:43:10',' 2023-09-12 11:02:00','4','0','','');
