;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;degree of protection:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; IP54&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Environmental conditions:&amp;nbsp;&amp;nbsp; 0-45 ° C&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;package weight:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 50KG&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;Control software:&amp;nbsp;&amp;nbsp;&amp;nbsp; Independent research and development&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size: 16px;line-height:150%;font-family:&amp;#39;Arial&amp;#39;,sans-serif&quot;&gt;service life laser theoretically:&amp;nbsp;&amp;nbsp;&amp;nbsp; 50,000 hours&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','','','','ModelHC-2020TypeC02 laser printerLaser power 20WLaser wavelength10.6/9.3μmMarking line depth≤0.01mmMarking line speed≤10000mm/sMinimum line width0.1mmminimum character0.3mmRepeatability0.01mmhostindependent research and developmentpower &amp;nbs',255,'1','0','0','0',50,0,0,'admin','admin','2023-05-31 14:45:01',' 2023-09-12 15:01:30','4','0','','');
