INSERT INTO ay_content_ext VALUES(16,82,NULL,NULL,NULL,NULL,'&lt;p&gt;&lt;span style=&quot;color: rgb(39, 38, 38); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255);&quot;&gt;Our mission is to ensure customers’ plants working&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(39, 38, 38); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px; text-align: justify;&quot;&gt;properly&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(39, 38, 38); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px; text-align: justify;&quot;&gt;and help customers win their market. Our main products include drinking water bottling production line, CSD production lines, juice production lines,&amp;nbsp; PET bottle blowing machines, injection molding machines, and so on.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(39, 38, 38); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif; font-size: 16px; text-align: justify;&quot;&gt;&amp;nbsp; &amp;nbsp;We will carry on to meet the demands of our customers and seek deeper cooperation with them. We will provide you with reliable and ecomonic filling and packaging systems, and will give you complete advice from the begining. Find out together with us how you can generate extra profit for your value creation process in the long term.&lt;/span&gt;&lt;/p&gt;',NULL,NULL);
INSERT INTO ay_content_ext VALUES(17,83,NULL,NULL,NULL,NULL,'&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: #ffffff;&quot;&gt; Customer first, Service first.&lt;/span&gt;&lt;br/&gt;&lt;span style=&quot;color: #ffffff;&quot;&gt;Talent people-oriented, focus on training.&lt;/span&gt;&lt;/p&gt;',NULL,NULL);
