INSERT INTO ay_site VALUES(1,'cn','ISBEST MACHINE','WE ARE ISBEST MACHINE','text10.vip01.06net.com','/static/upload/image/20230530/1685454629722404.png','water filling machine, water filling line, water filling plant, water bottling machine, water bottling line, water bottling plant',replace(replace('Our company-Isbest Machine has rich experience over the course of many years, making us the leading manufacturer in the beverage production industry. Our seasoned, qualified expects have a wide range of professional skills. We aim to bring you the quality solution and services. \r\nWe currently provide much more beverage filling lines for more than 60 countries in the world and we are continuously growing. Our company is dedicated to constant research in this fastest, growing market to ensure that both, we will stay ahead with our customers in this industry.\r\nIsbest Machine as one of the leading, beverage-packing machine manufacturers has provided quality equipment and amazing service to many of our customers worldwide such as Kenya, Bangladesh, Libya, Congo, Thailand, Malysia, Brunei. We strive to ensure the utmost quality in everything we do. ','\r',char(13)),'\n',char(10)),'Zhangjiagang Isbest Packing Machinery Co., Ltd','default','','Copyright © 2018-2023 Zhangjiagang Isbest Packing Machinery Co., Ltd All Rights Reserved.');
